No ha sido la temporada mas larga ni con las mejores nevadas, pero ha sido fantástica, días de polvo, mucho sol, fuerapistas, amistad, risas, motivación, caídas, kalimotxos, pintxos de tortilla,  tertulias de telesilla, parkineo y os aseguro que mucho engorile. Llegamos a la primavera y sin apenas nieve en las pistas, unos cuantos motivados nos unimos para despedir la temporada disfrutando como si de un día de “pow” se tratase de lo que mas nos gusta. El Snowboard y la montaña.  Gracias chicos por todos estos momentos increíbles!! 
La próxima temporada mas y mejor 🫶
